import React from "react";
import Logo from "./asset/logo.png";

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div>
        <img src={Logo} alt="logo"></img>
      </div>
      <div></div>
    </div>
  );
};

export default Sidebar;
